import React from 'react';
import Ana from '../images/Ana.png'
const AboutMe = () => {

    return(
        <div className="w-[1259px] h-80 flex left-30 top-300">
    <div className="left-[39px] top-0 absolute justify-start text-white text-3xl font-extrabold ">Sobre Mim</div>
    <div className="w-[771px] h-64 left-0 top-[81px] absolute bg-white rounded-[20px]" />
    <div className="w-[649px] h-44 left-[39px] top-[126px] absolute justify-start text-black text-xl font-normal">Olá! Sou Ana Carolina Leite, uma desenvolvedora web apaixonada por criar experiências digitais incríveis. Com experiência em React.js, JavaScript e outras tecnologias modernas, busco sempre entregar soluções elegantes e funcionais para os desafios que encontro. Estou sempre em busca de novos conhecimentos e desafios para expandir minhas habilidades e criar projetos cada vez mais impactantes.</div>
  <img className="w-80 h-80 left-[820px] top-0 absolute"
  src={Ana}/>
    </div>
    )

}

export default AboutMe;
